      carData:state.data.find(res=>res.model ===id)

  }
}
const mergeProps=(stateProps,dispachProps,ownProps)=>{
  return {
    ...stateProps,...dispachProps,...ownProps
};
}
export default connect(mapStateToProps,{},mergeProps)(App);
